[User defined type guards](http://www.typescriptlang.org/docs/handbook/advanced-types.html) (introduced in TS 1.6) allow union types to include Moment interfaces while allowing for strong typing, such as:

``` typescript
addHour(date: Moment | Date) {
    if (moment.isMoment(date) {
        date.add(1, "hours");
    } else {
        date.setHours(date.getHours() + 1);
    }
    return date;
}
```

Type guards still return `boolean`, so existing usages of these functions won't be affected.
